import React from "react";
import classes from "./mainsec.module.css"
const Mainsec = () => {
  return (
      <div>
      <div className={classes.center}>
          <h1 className={classes.tx}>
              Crypto Tracker
          </h1>
         < hr className={classes.new1}/>
      </div>
      </div>


   )
};

export default Mainsec;
